import React from 'react';
import { Link } from 'react-router-dom'
import Quiz from './Quiz'
import './App.scss';

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <p>
          Did You Escape from NY or LA?
        </p>
        <Link to="/quiz">
          <button className="btn">
            Start Quiz
          </button>
        </Link>

      </header>
    </div>
  );
}

export default App;
